import React from 'react';
import {Link} from 'react-router-dom';
// Styles
import './SideBar.css';

export const SideBar = () => {
  let clubs = ['test', 'test2', 'test3', 'test4', 'test5'];
  let clubsUsed = [];
  for (let i = 0; i < 6; i++) {
    // Random value in the clubs array
    let selectedClub = clubs[Math.floor(Math.random() * clubs.length)];
    /*for (let j = 0; i < clubsUsed.length; j++) {
      if (selectedClub == clubsUsed[j]) {
        break;
      } else {
      */clubsUsed.push(selectedClub);/*
      }
    }*/
  }
  return (
    <div>
      <p>Test</p>
      {clubsUsed.map(club => {
        switch (club) {
          case 'test':
            return <Link to='/'>Test</Link>;
          break;
          case 'test2':
            return <Link to='/contact'>Test 2</Link>;
          break;
          case 'test3':
            return <Link to='/join'>Test 3</Link>;
          break;
          case 'test4':
            return <strong>Test 4</strong>;
          break;
          case 'test5':
            return <em>Test 5</em>;
          break;
          default:
            return <p>Looks like an oopsie happened!</p>;
          break
        }
      })}
    </div>
  );
}
